// Checkout.js
import React from 'react';
import './Checkout.css';

const Checkout = ({ totalCartValue }) => {
    return (
        <div className="checkout-section">
            <h2>Checkout</h2>
            <p>Total: ${totalCartValue.toFixed(2)}</p>
            <button className="checkout-button">Proceed to Checkout</button>
        </div>
    );
};

export default Checkout;
